import './App.css'; 
import Header from './components/Header';
import Movie from './components/Movie';
import movies from './movie.json'

function App() {

  let login = false;




  return (
    <div className="App">
    {
      login == false ? <h1 style ={{color:black}}>no entry</h1>:<div></div>
    }
       <Header/>
       <div className="main">
       {
        movies.map((element,index) => {
          return(
        <Movie 
        key={index} 
        title ={element.Title} 
        year={element.Year}
        img={element.Poster}

         />
          )
       })
       }
       </div>
    </div>

  );
}

export default App;
